import ChatApp from './components/ChatApp';

import './styles/App.css';

const App = () => {
    const user = {
        name: 'Beto',
        avatar: 'https://via.placeholder.com/150'
    };

    return (
        <div className="app-container">
            <Sidebar user={user} />
            <ChatApp />
        </div>
    );
};

export default App;
